import React from "react";
import BabyNamesData from "./BabyNamesData.json"

const Names = (props) => {
  return(
    <div>
      <p>here I want to list the data</p>
      <ul>
        {BabyNamesData.map((x, i)=>{
          return (<li key={i}>{x}</li>)

        })}
      </ul>
    </div>
  )
};
export default Names;
